/// <summary>
/// Applies effective date filter selected.
/// </summary>
/// <param name="_filterOptions">
/// Date filter option parameter.
/// </param>
/// <param name="_showAsOfDateTime">
/// Effective date time for a filter.
/// </param>
public void applyFilter()
{        
    utcDateTime maximumDate, minimumDate;

    if(Filter.selection() == HMActiveAll::Active)
    {
        maximumDate = DateTimeUtil::maxValue();

        HMClaimVersion_ds.validTimeStateAutoQuery(ValidTimeStateAutoQuery::AsOfDate);
        HMClaimVersion_ds.query().validTimeStateAsOfDateTime(maximumDate);
    }
    else if(Filter.selection() == HMActiveAll::All)
    {
        minimumdate = DateTimeUtil::minValue();
        maximumDate = DateTimeUtil::maxValue();

        HMClaimVersion_ds.validTimeStateAutoQuery(ValidTimeStateAutoQuery::DateRange);
        HMClaimVersion_ds.query().validTimeStateDateTimeRange(minimumDate, maximumDate);
    }
}

public void init()
{
    super();

    if(element.args().menuItemName() == menuitemDisplayStr(HMClaimTableView))
    {
        element.design().caption("@MAZ10490");
        MainInstruction.text("@MAZ10490");
        CancelButton.text("@SYS5469");  

        element.applyFilter();
    }

}

/// <summary>
///
/// </summary>
/// <returns></returns>
public int active()
{
    int ret;

    ret = super();

    if(HMClaimVersion.AfterDIsputed == NoYes::Yes)
    {
        qbrChargeLineDIspute.value(queryValue(HMClaimVersion.AfterDIsputed));
        qbrChargeLineDIspute.enabled(true);

        HMClaimChargeLine_ds.executeQuery();
    }
    else
    {
        qbrChargeLineDIspute.enabled(false);

        HMClaimChargeLine_ds.executeQuery();
    }

    return ret;
}

public void init()
{
    super();
    this.queryBuildDataSource().addSortField(fieldNum(HMClaimChargeLine,Priority));

    qbrChargeLineDIspute = this.queryBuildDataSource().addRange(fieldNum(HMClaimChargeLine, Disputed));
}

public void initValue()
{
    HMClaimChargeLine.HMClaimTable = HMClaimTable.RecId;

    super();
}

