void clicked()
{
    Args                            args = new Args();
    HMResourceSchedulingAppointment appointment;
    HMPatientChargeEntryTable       chargeEntryTable;

    super();

    chargeEntryTable    = HMPatientChargeEntryTable::find(HMClaimTable.HMPatientChargeEntryTable);
    appointment         = HMResourceSchedulingAppointment::find(chargeEntryTable.HMResourceSchedulingAppointment);

    if (appointment)
    {
        args.record(appointment);
    }

    HMClaimAdministrationFormController::main(args);
}
